INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 7001, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 7, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 7002, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 7, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 7003, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 7, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 10001, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 10, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 10002, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 10, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 10003, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 10, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シェフィ", 10004, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 106401, 1, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 10, 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 12001, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -416.5, 12, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 13001, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 13, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 13002, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 13, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シェフィ", 13003, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 106401, 1, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 13, 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 13004, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 13, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 14001, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 14, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シェフィ", 14002, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 106401, 1, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 14, 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 14003, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 14, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 14004, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 14, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 15001, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -470.0, 15, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シェフィ", 16001, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 106401, 1, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 16, 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 16002, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 16, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 16003, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 16, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 16004, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 16, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 17002, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 17, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 17004, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 25, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 17005, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 25, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シェフィ", 17006, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 106401, 1, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 25, 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 17007, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 25, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 18001, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 190801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 18, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 18002, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 190801, 1, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, -363.0, 18, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 19001, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 190801, 1, 1, 0.0, 3, "2030/12/17 14:59:59", 0.0, -470.0, 19, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 19002, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 190801, 1, 1, 0.0, 4, "2030/12/17 14:59:59", 0.0, -470.0, 19, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 20001, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 190801, 1, 1, 0.0, 5, "2030/12/17 14:59:59", 0.0, -470.0, 20, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 20002, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 190801, 1, 1, 0.0, 6, "2030/12/17 14:59:59", 0.0, -470.0, 20, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("キャル", 21001, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 106001, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 21, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("コッコロ", 21002, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 105901, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 21, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シェフィ", 21003, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 106401, 1, 2, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 21, 2104010, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("ペコリーヌ", 21004, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 105801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -363.0, 21, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 22001, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 190801, 1, 1, 0.0, 1, "2030/12/17 14:59:59", 0.0, -430.0, 22, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 22002, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 190801, 1, 1, 0.0, 2, "2030/12/17 14:59:59", 0.0, -430.0, 22, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 23001, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 190801, 1, 1, 0.0, 3, "2030/12/17 14:59:59", 0.0, -430.0, 23, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("カリン", 23002, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 190801, 1, 1, 0.0, 4, "2030/12/17 14:59:59", 0.0, -430.0, 23, 0, 0);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24001, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 109001, 2, 1, 4.08, 1, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24002, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 109001, 2, 1, 5.0, 2, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24003, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 109001, 2, 1, 10.11, 3, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24004, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 109001, 2, 1, 4.0, 4, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24005, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 109001, 2, 1, 6.0, 5, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24006, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 109002, 1, 1, 0.0, 6, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24007, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 109002, 1, 1, 0.0, 7, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24008, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 109002, 1, 1, 0.0, 8, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24009, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 109002, 1, 1, 0.0, 9, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("エリコ（バレンタイン）", 24010, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 109002, 1, 1, 0.0, 10, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24011, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 109101, 2, 1, 2.12, 1, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24012, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 109101, 2, 5, 4.19, 2, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
