INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24015, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 109101, 2, 5, 5.23, 5, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24016, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 109102, 1, 1, 0.0, 6, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24017, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 109101, 2, 1, 5.01, 7, "2030/12/17 14:59:59", 8.0, -385.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24018, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 109102, 1, 1, 0.0, 8, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
INSERT INTO `v1_8b97fcffbb77f09a224b89af094bbbce27a589b60fe8c3f06896c4c2dadda501` VALUES ("シズル（バレンタイン）", 24019, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 109102, 1, 1, 0.0, 9, "2030/12/17 14:59:59", 0.0, 0.0, 24, 0, 10011);
